import './App.css';
import {
  BrowserRouter,
  Switch,
  Route,
} from "react-router-dom";

import HomePage from './pages/HomePage';

function App() {

  return (
    <BrowserRouter>
        <Route>
          <Route path="/" element={<HomePage />} />
        </Route>
    </BrowserRouter>
  );
}

export default App;
